import os
import csv
import json
from datetime import datetime

class BrokerApplication:
    def __init__(self):
        self.submissions = {}
        self.validation_results = []
        self.published_fabs_files = []
        self.funding_agency_codes = {}

    def upload_file(self, file_path):
        if not os.path.isfile(file_path):
            return "Error: File does not exist."

        # Validate file format (CSV assumed)
        if not file_path.endswith('.csv'):
            return "Error: Unsupported file format. Please upload a CSV file."

        with open(file_path, 'r') as file:
            data = list(csv.DictReader(file))
            validation_errors = self.validate_data(data)
            submission_id = len(self.submissions) + 1
            self.submissions[submission_id] = {
                'data': data,
                'status': 'Pending',
                'errors': validation_errors
            }
            if validation_errors:
                return f"Validation failed for submission {submission_id}: {validation_errors}"
            else:
                self.submissions[submission_id]['status'] = 'Validated'
                self.generate_d1_file(data)
                self.generate_fabs_file(data)
                return f"File uploaded and validated successfully. Submission ID: {submission_id}"

    def validate_data(self, data):
        errors = []
        for idx, record in enumerate(data):
            if 'required_field' not in record or not record['required_field']:
                errors.append(f"Record {idx + 1}: 'required_field' is missing.")
            # Additional validation logic can be added here
        return errors

    def generate_d1_file(self, data):
        d1_file_path = 'd1_file.json'
        with open(d1_file_path, 'w') as d1_file:
            json.dump(data, d1_file)
        print(f"D1 file generated at {d1_file_path}")

    def generate_fabs_file(self, data):
        fabs_file_path = f'fabs_file_{datetime.now().strftime("%Y%m%d%H%M%S")}.csv'
        with open(fabs_file_path, 'w', newline='') as fabs_file:
            writer = csv.DictWriter(fabs_file, fieldnames=data[0].keys())
            writer.writeheader()
            writer.writerows(data)
        self.published_fabs_files.append(fabs_file_path)
        print(f"FABS file generated at {fabs_file_path}")

    def track_submission_status(self, submission_id):
        submission = self.submissions.get(submission_id)
        if submission:
            return submission['status']
        else:
            return "Error: Submission ID not found."

    def report_user_feedback(self, feedback):
        with open('feedback.txt', 'a') as feedback_file:
            feedback_file.write(f"{datetime.now()}: {feedback}\n")
        return "Feedback submitted successfully."

    def retrieve_published_fabs_files(self):
        return self.published_fabs_files

    def derive_funding_agency_codes(self):
        for submission_id, submission in self.submissions.items():
            for record in submission['data']:
                agency_code = record.get('agency_code')
                if agency_code:
                    self.funding_agency_codes[agency_code] = self.funding_agency_codes.get(agency_code, 0) + 1
        return self.funding_agency_codes

    def add_validation_result(self, result):
        self.validation_results.append(result)
        return "Validation result added successfully."

# Example usage
broker_app = BrokerApplication()
print(broker_app.upload_file('data.csv'))
print(broker_app.track_submission_status(1))
print(broker_app.retrieve_published_fabs_files())
print(broker_app.report_user_feedback("Great application, but needs more validation checks."))
print(broker_app.derive_funding_agency_codes())
print(broker_app.add_validation_result({"submission_id": 1, "result": "Success", "errors": []}))
